// Lookup function
function getTownFromPIN(pincode) {
    const data = KERALA_PINCODES[pincode];
    if (!data) return null;
    
    // Handle both formats: string or object
    return typeof data === 'string' ? data : data.town;
}

// Get district (if available)
function getDistrictFromPIN(pincode) {
    const data = KERALA_PINCODES[pincode];
    if (!data || typeof data === 'string') return null;
    return data.district;
}

// Get all roads for a PIN (for future additions)
function getRoadsForPIN(pincode) {
    const data = KERALA_PINCODES[pincode];
    if (!data || typeof data === 'string') return [];
    return data.roads || [];
}

// Add a new road to a PIN
function addRoadToPIN(pincode, roadName) {
    const data = KERALA_PINCODES[pincode];
    if (!data) return false;
    
    // Convert string format to object format if needed
    if (typeof data === 'string') {
        KERALA_PINCODES[pincode] = {
            town: data,
            roads: [roadName]
        };
        return true;
    }
    
    // Add to existing object
    if (!data.roads) data.roads = [];
    if (!data.roads.includes(roadName)) {
        data.roads.push(roadName);
        return true;
    }
    return false;
}

// Check if a PIN exists in database
function isValidKeralaPIN(pincode) {
    return pincode in KERALA_PINCODES;
}

// Get all available PIN codes
function getAllPINCodes() {
    return Object.keys(KERALA_PINCODES);
}

// Search towns by partial name
function searchTowns(query) {
    const results = [];
    const lowerQuery = query.toLowerCase();
    
    for (const [pin, data] of Object.entries(KERALA_PINCODES)) {
        const town = typeof data === 'string' ? data : data.town;
        if (town.toLowerCase().includes(lowerQuery)) {
            results.push({ pin, town });
        }
    }
    
    return results;
}
